                                                        <div class="icon-outer">
                                                            <span class="icon icon-plus far fa-plus"></span>
                                                            <span class="icon icon-minus far fa-minus"></span>
                                                        </div>
                                                        speed a device need?
                                                    </div>
                                                    <div class="acc-content ">
                                                        <div class="content">
                                                            <div class="row">
                                                                <div class="col-lg-6 col-md-6 col-sm-12">
                                                                    <img class="accordian-width" src="uploads/2022/internet-test/3-2.jpg" alt="" style="max-height: 230px" class="w-full">
                                                                </div>
                                                                <div class="col-lg-6 col-md-6 col-sm-12">
                                                                    <div class="text">Depending on the activity, your device will need different connection speeds to operate smoothly. When downloading large files, the more speed, the better.
